export const EmptyView = ({ isLoad, viewObj, setDate, viewDate }) => {
  const viewContent = (
    <div
      className="listView__item-box"
      onClick={() => setDate(new Date(viewDate))}
    >
      <span className="listView__item-date"> {viewDate.substr(5)}</span>
    </div>
  );
  return viewContent;
};

